import React from 'react';

const TopNavigation = () => {
  return (
    <nav className="border-b border-ella-border flex items-center" style={{width: '1157px', paddingLeft: '1104px', paddingTop: '22px', paddingBottom: '22px'}}>
      <div className="w-5 h-5 text-gray-600 hover:text-gray-800 cursor-pointer">
        <svg fill="currentColor" viewBox="0 0 24 24">
          <path d="M12 12c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm0 2c-2.67 0-8 1.34-8 4v2h16v-2c0-2.66-5.33-4-8-4z"/>
        </svg>
      </div>
    </nav>
  );
};

export default TopNavigation;
